- input: "TEXT\x1CC00411173\x1C.TEXT\x1C\x1CF3XA\x1CThere were two (2) contributions
    made by CMSA that would have caused a discrepancy in the opening and closing balances
    of our filing.  In 2006, we made a contribution to Capito for Congress via check.
    \ However, the check was not cashed.  Further, in the 2Q of 2007, a contribution
    check was send to Baker for Congress - this check was not cashed as well.  Both
    checks were reissued in the 3rd Q of 2007.  In order to account for this adjustment,
    we amended the previous report and indicated the appropriate negative entries
    in order to balance the account.  Further, as of 10/16/08, the contribution check
    for McCrery for Congress written on 04/25/07 was not cashed, as McCrery is scheduled
    to retire.  We amended this contribution in the July 31, 2007 midyear filing report.
    \ Please let us know if you require any further information."
